import './../App.css';
import React, { Component } from 'react';

class ResourcesPage extends Component {
  render() {
    return (
      <div>
        <p>Here are some resources you can use to learn about agriculture:</p>
        <div className="youtube-cards">
          <div className="youtube-card">
            <iframe width="100%" height="315" src="https://dai.ly/x6upyx9https://www.dailymotion.com/embed/video/x5zy5nv" title="FarmersTV"></iframe>
            <h2>FarmersTV</h2>
            <p>A video streaming platform featuring videos about farming and agriculture.</p>
          </div>
          <div className="youtube-card">
            <iframe width="100%" height="315" src="https://www.dailymotion.com/embed/video/x8p8f9v?playlist=x6bd5z" title="AgriLife Studios"></iframe>
            <h2>AgriLife Studios</h2>
            <p>A video streaming platform featuring videos about agriculture and life on the farm.</p>
          </div>
          <div className="youtube-card">
            <iframe width="100%" height="315" src="https://www.dailymotion.com/embed/video/x2mawou" title="Krishi Jagran"></iframe>
            <h2>Krishi Jagran</h2>
            <p>A video streaming platform featuring videos about agriculture and farming in India.</p>
          </div>
        </div>
      </div>
    );
  }
}

export default ResourcesPage;
